import { useAppSelector } from '../../app/hooks'
import { Tools } from '../../utils/Tools'
import { Types } from '../../utils/Types'
import CurrencyValue from './CurrencyValue'

export default function Currencies() {
	const currencies = useAppSelector((state) => state.currencies.currencies)
	const isLoading = useAppSelector((state) => state.currencies.loading)
	return Types.mainCurrencies.map((currency) => (
		<>
			<h5>{currency}</h5>
			{': '}
			<CurrencyValue
				baseCurrency={currency}
				mainCurrencies={Tools.getMainCurrencies(currency, currencies)}
			/>
		</>
	))
}
